	this.timeline.addTween(cjs.Tween.get({}).to({state:[{t:this.up_white},{t:this.down_white}]}).wait(1));

	// noble_msk (mask)
	var mask = new cjs.Shape();
	mask._off = true;
	mask.graphics.p("AoMBLIAAiVIQZAAIAACVg");
	mask.setTransform(47.5,64.5);

	// noble
	this.shape = new cjs.Shape();
	this.shape.graphics.f("#1F1E15").s().p("");
	this.shape.setTransform(47.9,64.8);

	var maskedShapeInstanceList = [this.shape];

	for(var shapedInstanceItr = 0; shapedInstanceItr < maskedShapeInstanceList.length; shapedInstanceItr++) {
		maskedShapeInstanceList[shapedInstanceItr].mask = mask;
	}

	this.timeline.addTween(cjs.Tween.get(this.shape).wait(1));

	// oak_msk (mask)
	var mask_1 = new cjs.Shape();
	mask_1._off = true;
	mask_1.graphics.p("AmPBLIAAiVIMfAAIAACVg");
	mask_1.setTransform(150,64.5);

	// oak
	this.shape_1 = new cjs.Shape();
	this.shape_1.graphics.f("#1F1E15").s().p("");
	this.shape_1.setTransform(149.4,64.8);

	var maskedShapeInstanceList = [this.shape_1];

	for(var shapedInstanceItr = 0; shapedInstanceItr < maskedShapeInstanceList.length; shapedInstanceItr++) {
		maskedShapeInstanceList[shapedInstanceItr].mask = mask_1;
	}

	this.timeline.addTween(cjs.Tween.get(this.shape_1).wait(1));

	// double_msk (mask)
	var mask_2 = new cjs.Shape();
